import logo from './logo.svg';
import './App.css';

class App extends React.Component {					

	constructor(props){
		super(props);

		this.state = {
			places: PLACES
		};
	}

	render(){
		return (
			<div className='App'>

					<div className="container" id="brand">
						<NavbarBrand>Incredible India</NavbarBrand>
					</div>

				<h1>Famous Places of India</h1>
				<Menu places={this.state.places} />
			</div>
		);
	}
}

export default App;
